using Microsoft.VisualStudio.TestPlatform.ObjectModel.Engine.ClientProtocol;
using Xunit.Abstractions;

namespace AdventOfCodeTest;

public class Day1(ITestOutputHelper outputHelper)
{
    [Theory]
    [InlineData("R30\nL80")]
    [InlineData("R30\nL180")]
    public void DoSomething_Should_ResultIn(string data)
    {
        var ints = Data.Split('\n')
            .Select(s => int.Parse(s[1..]) * (s[0] == 'L' ? -1 : 1));

        var current = 50;
        var count = 0;

        foreach (var i in ints)
        {
            var start = current;
            current += i;
            var turns = current/100;
            count += Math.Abs(turns);
            current -= turns * 100;

            if (current < 0 && start != 0)
            {
                count++;
            }

            current += 100;
            current %= 100;

            if (current == 0 && (Math.Abs(turns) == 0 || turns < 0))
            {
                count++;
            }
            outputHelper.WriteLine($"Rotate {i}, now at {current}, total turns {count}");
        }

        // Start 1 Assert.Equal(1102, count);
        Assert.Equal(5911, count);
    }

